        static int[] CheckConcatenatedString(string s, string[] words)
        {
            List<int> result = new List<int>();
            if (string.IsNullOrEmpty(s) || words.Length == 0) return result.ToArray();

            int wordLength = words[0].Length;
            int totalLength = wordLength * words.Length;

            Dictionary<string, int> wordCount = new Dictionary<string, int>();
            foreach (string w in words)
            {
                if (!wordCount.ContainsKey(w))
                {
                    wordCount[w] = 1;
                }
                else
                {
                    wordCount[w]++;
                }
            }

            for (int i = 0; i < wordLength; i++)
            {
                int left = i;
                int right = i;

                Dictionary<string, int> temp = new Dictionary<string, int>();
                int count = 0;

                while (right + wordLength <= s.Length)
                {
                    string currentWord = s.Substring(right, wordLength);
                    right += wordLength;

                    if (wordCount.ContainsKey(currentWord))
                    {
                        temp[currentWord] = temp.GetValueOrDefault(currentWord, 0) + 1;
                        count++;

                        while (temp[currentWord] > wordCount[currentWord])
                        {
                            string leftWord = s.Substring(left, wordLength);
                            temp[leftWord]--;
                            left += wordLength;
                            count--;
                        }

                        if (count == words.Length)
                        {
                            result.Add(left);
                        }
                    }
                    else
                    {
                        temp.Clear();
                        count = 0;
                        left = right;
                    }
                }
            }


            return result.ToArray();
        }

